import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [alertInfo, setAlertInfo] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [objectName, field] = name.split(".");
      setFormData((prevData) => ({
        ...prevData,
        [objectName]: {
          ...prevData[objectName],
          [field]: value,
        },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      setAlertInfo({ type: 'danger', message: 'La fecha de nacimiento no puede ser futura.' });
      return;
    }

    if (year < 1900 || year > 2100) {
      setAlertInfo({ type: 'danger', message: 'El a침o de nacimiento debe estar entre 1900 y 2100.' });
      return;
    }

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
      usuario: {
        ...formData.usuario,
        id: {
          login: formData.usuario.login,
          persona: null,
        },
      },
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        setAlertInfo({ type: 'success', message: typeof responseData === 'object' ? responseData.message : responseData });
      } else {
        if (responseData.code === "DUPLICATE_ID" || responseData.code === "DUPLICATE_USER" || responseData.code === "DUPLICATE_EMAIL") {
          setAlertInfo({ type: 'danger', message: 'La identificaci칩n, nombre de usuario o correo electr칩nico ya est치n registrados.' });
        } else {
          setAlertInfo({ type: 'danger', message: typeof responseData === 'object' ? responseData.message : responseData });
        }
      }
    } catch (error) {
      console.error("Error:", error);
      setAlertInfo({ type: 'danger', message: 'Error en la solicitud.' });
    }
  };

  return (
    <div className="container-fluid py-5" style={{ 
      background: 'linear-gradient(to right, #212531, #c9b1ff)', 
      minHeight: '100vh'
    }}>
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-primary text-white">
              <h2 className="mb-0">Registrar Persona</h2>
            </div>
            <div className="card-body">
              {alertInfo && (
                <div className={`alert alert-${alertInfo.type}`} role="alert">
                  {alertInfo.message}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Primer Nombre:</label>
                    <input
                      type="text"
                      name="primerNombre"
                      className="form-control"
                      value={formData.primerNombre}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Segundo Nombre:</label>
                    <input
                      type="text"
                      name="segundoNombre"
                      className="form-control"
                      value={formData.segundoNombre}
                      onChange={handleChange}
                    />
                  </div>
                </div>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Primer Apellido:</label>
                    <input
                      type="text"
                      name="primerApellido"
                      className="form-control"
                      value={formData.primerApellido}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Segundo Apellido:</label>
                    <input
                      type="text"
                      name="segundoApellido"
                      className="form-control"
                      value={formData.segundoApellido}
                      onChange={handleChange}
                    />
                  </div>
                </div>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Identificaci칩n:</label>
                    <input
                      type="number"
                      name="identificacion"
                      className="form-control"
                      value={formData.identificacion}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Email:</label>
                    <input
                      type="email"
                      name="email"
                      className="form-control"
                      value={formData.email}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Fecha de Nacimiento:</label>
                    <input
                      type="date"
                      name="fechaNacimiento"
                      className="form-control"
                      value={formData.fechaNacimiento}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
                <h4 className="mb-3">Ubicaci칩n</h4>
                <div className="row mb-3">
                  <div className="col-md-4">
                    <label className="form-label">Direcci칩n:</label>
                    <input
                      type="text"
                      name="ubicacion.lugar"
                      className="form-control"
                      value={formData.ubicacion.lugar}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-4">
                    <label className="form-label">Ciudad:</label>
                    <input
                      type="text"
                      name="ubicacion.ciudad"
                      className="form-control"
                      value={formData.ubicacion.ciudad}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-4">
                    <label className="form-label">Departamento:</label>
                    <input
                      type="text"
                      name="ubicacion.departamento"
                      className="form-control"
                      value={formData.ubicacion.departamento}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
                <h4 className="mb-3">Usuario</h4>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Login:</label>
                    <input
                      type="text"
                      name="usuario.login"
                      className="form-control"
                      value={formData.usuario.login}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Password:</label>
                    <input
                      type="password"
                      name="usuario.password"
                      className="form-control"
                      value={formData.usuario.password}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
                <div className="d-flex justify-content-between mt-4">
                  <button 
                    type="submit" 
                    className="btn btn-primary"
                  >
                    Guardar
                  </button>
                  <button 
                    type="button" 
                    className="btn btn-secondary" 
                    onClick={() => console.log("Return to login")}
                  >
                    Regresar a Login
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
